function replaceText(element, searchText, replacementText) {
    if (element.nodeType === Node.TEXT_NODE) {
        element.textContent = element.textContent.replace(new RegExp(searchText, 'g'), replacementText);
    } else if (element.nodeType === Node.ELEMENT_NODE) {
        element.childNodes.forEach(child => {
            replaceText(child, searchText, replacementText);
        });
    }
}

function xmods() {
    if (document.getElementById('windowHolder').style.display === 'none') { return false; }
    if (document.getElementById('xmods-css') !== null) { return true; }
    var parent = document.getElementById('menuWindow');
    if (parent === null) {
        return false;
    }
    var style = document.createElement('style');
    style.innerHTML = `
#menuWindow {
    background: #00000000 !important;
}
#settHolder, .CTabButton, .checkmark, input[type='number'], select, #keybindButton_airtogglekey, #keybindButton_fakepeekkeybind, #keybindButton_guitoggle, #valueInput, #importConfig, #copysettings {
    background: rgba(245, 245, 255, 0.112) !important;
    border: 0.1vw solid rgba(255, 255, 255, 0.164) !important;
}
#settHolder {
    backdrop-filter: blur(20px) !important;
}
.cTabActive {
    background: rgba(245, 245, 255, 0.25) !important;
}
.tab-icon {
    filter: brightness(0) invert(1);
}
#settHolder * {
    color: #ffffff !important;
}
.custom-checkbox input:checked ~ .checkmark {
    background-color: #ffffff !important;
}
input[type='color'] {
    border: 0.1vw solid rgba(255, 255, 255, 0.164) !important;
}
option {
    color: #000000 !important;
}
#keybindButton_airtogglekey, #keybindButton_fakepeekkeybind, #keybindButton_guitoggle, #valueInput, #importConfig, #copysettings, #loadrage {
    border-radius: 5px !important;
}
    `;
    style.id = 'xmods-css';
    parent.insertBefore(style, parent.firstChild);

    document.querySelectorAll('.settName').forEach(element => {
        element.style.setProperty('color', 'white', 'important');
    });

    var foundimg = document.getElementById('settHolder').querySelectorAll('img')[0];
    foundimg.src = 'https://github.com/qwkdev/x/blob/main/img/logo2.png?raw=true';
    foundimg.height = '200';
    replaceText(document.getElementById('C-tab-Main'), 'FEMBOT ', '');
    replaceText(document.getElementById('C-tab-Main'), 'Unsilent', '(OP) Snap');

    var menu = document.getElementById('C-tab-Menu');
    if (menu && menu.lastElementChild) {
        const outerDiv = document.createElement('div');
        outerDiv.id = `config`;
        outerDiv.style.cssText = `
            width: 100%;
            display: grid;
            grid-template-columns: repeat(3, calc(calc(100% - 40px) / 3));
            column-gap: 20px;
            row-gap: 10px;
            height: min-content;
            margin-top: 20px;
        `;
        config.forEach((item, index) => {
            const innerDiv = document.createElement('div');
            innerDiv.style.cssText = `
                font-family: sans-serif;
                font-size: 24px;
                line-height: 44px;
                cursor: pointer;
                width: 100%;
                height: 44px;
                background: rgba(245, 245, 255, 0.112) !important;
                border: 0.1vw solid rgba(255, 255, 255, 0.164) !important;
                border-radius: 5px !important;
            `;
            innerDiv.innerText = config_names[index];
            innerDiv.onclick = function () {
                try {
                    const inputsettings = JSON.stringify(item);
                    console.log(inputsettings);
                    window.localStorage.setItem('fmbt', inputsettings);
                    document.getElementById('valueInput').value = inputsettings;
                    const message = 'Config imported successfully!';
                    const notification = document.getElementById('notification');
                    notification.innerHTML = message;
                    notification.style.display = 'block';
                    setTimeout(() => {
                        notification.style.display = 'none';
                    }, 2000);
                } catch (error) {
                    console.error('Error importing configuration:', error);
                }
            };
            outerDiv.appendChild(innerDiv);
            menu.lastElementChild.appendChild(outerDiv);
        });
    } else {
        return false;
    }

    return true;
}

setInterval(xmods, 200);
